import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";

import front from "./images/front.jpeg";

let content= <h1>This is a custom heading</h1>;
let content2 = <img src={front} className="front-picture" alt="Front Picture"/>
class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
       <Section
          title=""
          body={content2}
          id="section1"
        />
      </div>
    );
  }
}

export default App;
